function data($query){
    $consulta=mysql_query($query);
    if(!$consulta){
        echo mysql_error();
    }
    else {
        echo '<b class="text">OK</b>';
    }
    $fields=mysql_num_fields($consulta);
    echo '<table class="tablas"><tr>';
    if($fields>0){
        for($c=0; $c<$fields; $c++){
            echo '<td class="tablas">'.mysql_field_name($consulta, $c).'</td>';            
        }
        echo '<tr>';
        
        while($campos=mysql_fetch_row($consulta)){
            for($d=0; $d<$fields; $d++){
                echo '<td class="tablas">'.$campos[$d].'</td>';
            
        }
            echo '<tr>';
        }
    }
    echo '</table>';
    echo mysql_info();
    mysql_free_result($consulta);
    
    
    
}
