function permiso($archivo){
    $perms=fileperms($archivo);
    return substr(sprintf('%o', $perms), -3);
}

function copiar_dir($origen, $destino){
    
    mkdir($destino, 0777, true);
    
    $abrir_dir=opendir($origen);
    
    while($files=readdir($abrir_dir)){
        if($files=='.'|| $files=='..'){
                continue;
        }
        else {
            if(is_file($origen.DIRECTORY_SEPARATOR.$files)){
                copy($origen.DIRECTORY_SEPARATOR.$files, $destino.DIRECTORY_SEPARATOR.$files);
                
            }
            else {
                copiar_dir($origen.DIRECTORY_SEPARATOR.$files, $destino.DIRECTORY_SEPARATOR.$files);
            }
        
    }
    }
    
    closedir($abrir_dir);
    
    
}



function borrar_dir($origen){
    $abrir_dir=opendir($origen);
    
    while($files=readdir($abrir_dir)){
        if($files=='.' || $files=='..'){
            continue;
        }
        else {
            if(is_file($origen.DIRECTORY_SEPARATOR.$files)){
                unlink($origen.DIRECTORY_SEPARATOR.$files);
            }
            else{
                borrar_dir($origen.DIRECTORY_SEPARATOR.$files);
            }
        }
    }
    
    closedir($abrir_dir);
    rmdir($origen);
}



